stateMachine.definition:
{
  "Comment": "A description of my state machine",
  "StartAt": "data serialization",
  "States": {
    "data serialization": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:362937446996:function:ml-project-function-1:$LATEST"
      },
      "Next": "get inferences",
      "Credentials": {
        "RoleArn": "arn:aws:iam::362937446996:role/subh-lambda-role-1"
      },
      "OutputPath": "$.Payload.body"
    },
    "get inferences": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:362937446996:function:ml-function-2:$LATEST"
      },
      "Next": "filter inferences",
      "Credentials": {
        "RoleArn": "arn:aws:iam::362937446996:role/subh-lambda-role-1"
      },
      "OutputPath": "$.Payload.body"
    },
    "filter inferences": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:362937446996:function:ml-project-function-3:$LATEST"
      },
      "Credentials": {
        "RoleArn": "arn:aws:iam::362937446996:role/subh-lambda-role-1"
      },
      "OutputPath": "$.Payload.body",
      "Next": "Choice"
    },
    "Choice": {
      "Type": "Choice",
      "Choices": [
        {
          "Variable": "$.inference_result",
          "StringMatches": "pass",
          "Next": "Success"
        },
        {
          "Variable": "$.inference_result",
          "StringMatches": "fail",
          "Next": "Fail"
        }
      ]
    },
    "Success": {
      "Type": "Succeed"
    },
    "Fail": {
      "Type": "Fail"
    }
  }
}
